import React, { useEffect, useState } from "react";
import { fetchOrders, approvePO, orderPO } from "../api";
import {
  Box,
  Table,
  Text,
  Button,
  Center,
  HStack,
  Icon,
  Spinner,
} from "@chakra-ui/react";

import { CheckCircle, Truck, Clock } from "lucide-react";

const statusMap = {
  PENDING: { label: "PENDING", color: "yellow.500", icon: Clock },
  APPROVED: { label: "APPROVED", color: "blue.500", icon: CheckCircle },
  ORDERED: { label: "ORDERED", color: "green.600", icon: Truck },
};

export default function Dashboard() {
  const [orders, setOrders] = useState([]);

  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchOrders().then((res) => {
      setOrders(res.data);
      setLoading(false);
    });
  }, []);

  const handleApprove = (id) => {
    approvePO(id).then(() => window.location.reload());
  };

  const handleOrder = (id) => {
    orderPO(id).then(() => window.location.reload());
  };

  return (
    <Box p={8} minH="100vh">
      <Box maxW="6xl" mx="auto">
        <Text fontSize="2xl" fontWeight="bold" mb={6}>
          Purchase Order Dashboard
        </Text>

        <Box shadow="md" borderRadius="2xl" overflow="hidden">
          {loading ? (
            <Center p={10}>
              <Spinner size="lg" />
            </Center>
          ) : (
            <Table variant="simple" size="md">
              <thead>
                <tr>
                  <th>PO Title</th>
                  <th>Status</th>
                  <th textAlign="center">Actions</th>
                </tr>
              </thead>
              <tbody>
                {orders.map((po) => {
                  const status = statusMap[po.status];
                  return (
                    <tr key={po.ID} _hover={{ bg: "gray.50" }}>
                      <td fontWeight="medium">{po.title}</td>
                      <td>
                        <HStack color={status.color} fontWeight="semibold">
                          <Icon as={status.icon} boxSize={4} />
                          <Text>{status.label}</Text>
                        </HStack>
                      </td>
                      <td textAlign="center">
                        <HStack justify="center">
                          {po.status === "PENDING" && (
                            <Button
                              size="sm"
                              colorScheme="blue"
                              onClick={() => handleApprove(po.ID)}
                            >
                              Approve
                            </Button>
                          )}
                          {po.status === "APPROVED" && (
                            <Button
                              size="sm"
                              colorScheme="green"
                              onClick={() => handleOrder(po.ID)}
                            >
                              Mark Ordered
                            </Button>
                          )}
                          {po.status === "ORDERED" && (
                            <Text fontSize="sm" color="gray.500">
                              Completed
                            </Text>
                          )}
                        </HStack>
                      </td>
                    </tr>
                  );
                })}
                {orders.length === 0 && (
                  <tr>
                    <td colSpan={3}>
                      <Center py={6}>
                        <Text color="gray.500">No purchase orders found.</Text>
                      </Center>
                    </td>
                  </tr>
                )}
              </tbody>
            </Table>
          )}
        </Box>
      </Box>
    </Box>
  );
}
